import { createApp } from 'vue'
import ElementPlus from 'element-plus'
import 'element-plus/dist/index.css'
import App from './App.vue'
import router from './router'
import { createPinia } from 'pinia'
import { createPersistedState } from 'pinia-persistedstate-plugin'
import '@wangeditor/editor/dist/css/style.css'

const pinia = createPinia()
const persistedState = createPersistedState()
pinia.use(persistedState)

const app = createApp(App)

app.config.errorHandler = (err, vm, info) => {
    const msg = err?.message || ''
    if (
        msg.includes("'get' on proxy: property 'anchor' is a read-only") ||
        msg.includes("proxy target") ||
        msg.includes("expected '#<Object>' but got '#<Object>'")
    ) {
        // üîá ÈùôÈªòÂøΩÁï• WangEditor ÁâπÂÆöÊä•Èîô
        console.warn('[WangEditor warning suppressed]:', msg)
        return
    }

    console.error('[Vue error]:', err, info)
}

app.use(pinia)
app.use(router)
app.use(ElementPlus)
app.mount('#app')
